insert into billing.fee_schedule (descriptor, mbs_item, "group") values ($$the minimum requirements of care to complete an annual diabetes cycle of care for patients with established diabetes mellitus must be completed over a period of at least 11 months and up to 13 months, and must include:- assess diabetes control by measuring hba1c   at least once every  year- ensure that a comprehensive eye examination is carried out* at least once every two years- measure weight and height and calculate bmi**   at least twice every cycle of care- measure blood pressure     at least twice every cycle of care- examine feet***      at least twice every cycle of care- measure total cholesterol, triglycerides and hdl cholesterol at least once every year- test for microalbuminuria     at least once every  year- provide self-care education     patient education regarding diabetes management- review diet      reinforce information about appropriate dietary          choices- review levels of physical activity    reinforce information about appropriate levels of         physical activity- check smoking status     encourage cessation of smoking (if relevant)- review of medication     medication review* not required if the patient is blind or does not have both eyes.** initial visit: measure height and weight and calculate bmi as part of the initial patient assessment. subsequent visits: measure weight.*** not required if the patient does not have both feet.surgery consultations(professional attendance at consulting rooms)standard consultation of more than 5 minutes duration but not more than 25 minutes durationand which completes the minimum requirements of a cycle of care for a patient with established diabetes mellitus.$$,'2620','A19');
