insert into billing.fee_schedule (descriptor, mbs_item, "group") values ($$Note: Benefits are payable for only one service included in Subgroup 3 or a18, Subgroup 3 in a 12-month period, unless a further Asthma Cycle of Care is clinically indicated.  At a minimum the Asthma Cycle of Care must include: - at least 2 asthma related consultations within 12 months for a patient with moderate to severe asthma (at least 1 of which (the review consultation) is a consultation that was planned at a previous consultation) - documented diagnosis and assessment of level of asthma control and severity of asthma - review of the patient's use of and access to asthma related medication and devices - provision to the patient of a written asthma action plan (if the patient is unable to use a written asthma action plan – discussion with the patient about an alternative method of providing an asthma action plan, and documentation of the discussion in the patient's medical records - provision of asthma self-management education to the patient - review of the written or documented asthma action plan  surgery consultations  (Professional attendance at consulting rooms)  standard consultations of more than 5 minutes duration but not more than 25 minutes duration  and which completes the minimum requirements of the Asthma Cycle of Care.$$,'2664','A19');
