insert into billing.fee_schedule (descriptor, mbs_item, "group") values ($$Medical practitioner attendance (including a general practitioner, but not including a specialist or consultant physician) associated with provision of focussed psychological strategies  Note:  These services may only be provided by a medical practitioner who is registered with Medicare Australia as having satisfied the requirements for higher level mental health skills for the provision of the service.  Focussed psychological strategies are specific mental health care management strategies, derived from evidence based psychological therapies, that have been shown to integrate the best external evidence of clinical effectiveness with general practice clinical expertise. These strategies are required to be provided to patients by a credentialled medical practitioner and are time limited; being deliverable, in up to ten planned sessions per calendar year. in exceptional circumstances, following review by the practitioner managing the patient either under the gp mental health treatment plan or under the psychiatric assessment and management plan, up to a further 6 services may be approved from 1 march 2012 to 31 december 2012 to an individual patient. Medical practitioners must be notified to Medicare Australia by the General Practice Mental Health Standards Collaboration that they have met the required standards for higher level mental health skills. a session should last for a minimum of 30 minutes.   fps attendance Professional attendance for the purpose of providing focussed psychological strategies (from the list included in the Explanatory Notes) for assessed mental disorders by a medical practitioner registered with Medicare Australia as meeting the credentialling requirements for provision of this service, and lasting at least 30 minutes to less than 40 minutes.   surgery consultation (Professional attendance at consulting rooms)$$,'2721','A20');
