insert into billing.fee_schedule (descriptor, mbs_item, "group") values ($$overnight investigation for sleep apnoea for a period of at least 8 hours duration for a patient aged 18 years or more, if all of the following requirements are met:(a)  the patient has, before the overnight investigation, been referred to a qualified adult sleep medicine practitioner by a medical practitioner whose clinical opinion is that there is a high probability that the patient has obstructive sleep apnoea; and(b) the investigation takes place after the qualified adult sleep medicine practitioner has:      (i)  confirmed the necessity for the investigation; and       (ii) communicated this confirmation to the referring medical practitioner; and(c) during a period of sleep, the investigation involves recording a minimum of seven physiological parameters which must include:      (i) continuous electro-encephalogram (eeg); and      (ii) continuous electro-cardiogram (ecg; and      (iii) airflow; and      (iv) thoraco-abdominal movement; and      (v) oxygen saturation; and      (vi) 2 or more of the following:           (a) electro-oculogram (eog);           (b) chin electro-myogram (emg);           (c) body position; and(d) in the report on of the investigation, the qualified adult sleep medicine practitioner uses the data specified in paragraph (c) to:      (i) analyse sleep stage, arousals and respiratory events; and      (ii) assess clinically significant alteration in heart rate; and(e) the qualified adult sleep medicine practitioner:       (i) before the investigation takes place, establishes quality assurance procedures for data acquisition; and      (ii) personally analyses the data and writes the report on the results of the investigation.payable only once in a 12 month period.$$,'12250','D1');
