insert into billing.fee_schedule (descriptor, mbs_item, "group") values ($$Dosimetry for three dimensional conformal radiotherapy of level 3 complexity - where: (a) dosimetry for a three or more phase three dimensional conformal treatment plan using ct image volume dataset(s) with at least one gross tumour volume, three planning target volumes and one organ at risk defined in the prescription; or (b) dosimetry for a two phase three dimensional conformal treatment plan using ct image volume datasets with at least one gross tumour volume, and   (i) two planning target volumes; or   (ii) two organ at risk dose goals or constraints defined in the prescription. or (c) dosimetry for a one phase three dimensional conformal treatment plan using ct image volume datasets with at least one gross tumour volume, one planning target volume and three organ at risk dose goals or constraints defined in the prescription; or (d) image fusion with a secondary image (ct, mri or pet) volume dataset used to define target and organ at risk volumes in conjunction with and as specified in dosimetry for three dimensional conformal radiotherapy of level 2 complexity.  All gross tumour targets, clinical targets, planning targets and organs at risk as defined in the prescription must be rendered as volumes. The organ at risk must be nominated as planning dose goals or constraints and the prescription must specify the organs at risk as dose goals or constraints. Dose volume histograms must be generated, approved and recorded with the plan. a ct image volume dataset must be used for the relevant region to be planned and treated. The ct images must be suitable for the generation of quality digitally reconstructed radiographic images$$,'15562','T2');
