insert into billing.fee_schedule (descriptor, mbs_item, "group") values ($$Provision of a non-directive pregnancy support counselling service to a woman who is concerned about a current pregnancy or a pregnancy that occurred in the preceding 12 months, by an eligible psychologist, where the patient is referred to the psychologist by a medical practitioner (including a general practitioner, but not a specialist or consultant physician), and lasting at least 30 minutes. The service may be used to address any pregnancy related issues for which non-directive counselling is appropriate. This service may be provided by a psychologist who is registered with Medicare Australia as meeting the credentialling requirements for provision of this service.  It may not be provided by a psychologist who has a direct pecuniary interest in a health service that has as its primary purpose the provision of services for pregnancy termination.  To a maximum of three non-directive pregnancy support counselling services per patient, per pregnancy from any of the following items –81000, 81005, 81010 and 4001$$,'81000','M8');
