insert into billing.fee_schedule (descriptor, mbs_item, "group") values ($$Diabetes education health service provided to a person by an eligible diabetes educator for the purposes of ASSESSING a person's suitability for group services for the management of type 2 diabetes, including taking a comprehensive patient history, identifying an appropriate group services program based on the patient's needs, and preparing the person for the group services, if:(a) the service is provided to a person who has type 2 diabetes; and(b)  the person is being managed by a medical practitioner (including a general practitioner, but not a specialist or consultant physician) under a GP Management Plan [ie item 721 or 732], or if the person is a resident of an aged care facility, their medical practitioner has contributed to a multidisciplinary care plan [ie item 731]; and  (c) the person is referred to an eligible diabetes educator by the medical practitioner using a referral form that has been issued by the Department of Health and Ageing, or a referral form that contains all the components of the form issued by the Department; and(d) the person is not an admitted patient of a hospital; and(e) the service is provided to the person individually and in person; and(f) the service is of at least 45 minutes duration; and(g) after the service, the eligible diabetes educator gives a written report to the referring medical practitioner mentioned in paragraph (c); and(h)    in the case of a service in respect of which a private health insurance benefit is payable - the person who incurred the medical expenses in respect of the service has elected to claim the Medicare benefit in respect of the service, and not the private health insurance benefit.Benefits are payable once only in a calendar year for this or any other Assessment for Group Services item (including services to which items 81100, 81110 and 81120 apply).$$,'81100','M9');
insert into billing.prices (fk_fee_schedule, price, fk_lu_billing_type) values (currval('billing.fee_schedule_pk_seq'),'79.85',8);
insert into billing.fee_schedule (descriptor, mbs_item, "group") values ($$DIABETES EDUCATION SERVICE  GROUP SERVICE Diabetes education health service provided to a person by an eligible diabetes educator, as a GROUP SERVICE for the management of type 2 diabetes if:(a) the person has been assessed as suitable for a type 2 diabetes group service under assessment item 81100, 81110 or 81120; and(b)   the service is provided to a person who is part of a group of between 2 and 12 patients inclusive; and (c) the person is not an admitted patient of a hospital; and(d)   the service is provided to a person involving the personal attendance by an eligible diabetes educator; and(e)   the service is of at least 60 minutes duration; and(f) after the last service in the group services program provided to the person under items 81105, 81115 or 81125, the eligible diabetes educator prepares, or contribute to, a written report to be provided to the referring medical practitioner; and(g)   an attendance record for the group is maintained by the eligible diabetes educator; and(h)  in the case of a service in respect of which a private health insurance benefit is payable - the person who incurred the medical expenses in respect of the service has elected to claim the Medicare benefit in respect of the service, and not the private health insurance benefit;- to a maximum of eight  GROUP SERVICES (including services to which items 81105, 81115 and 81125 apply) in a calendar year.$$,'81105','M9');
insert into billing.prices (fk_fee_schedule, price, fk_lu_billing_type) values (currval('billing.fee_schedule_pk_seq'),'19.90',8);
