insert into billing.fee_schedule (descriptor, mbs_item, "group") values ($$Aboriginal and torres strait islander descent by an eligible aboriginal health worker or eligible aboriginal and torres strait islander health practitioner if:(a) a medical practitioner has undertaken a health assessment and identified a need for follow-up allied health services; and(b) the person is referred to the eligible aboriginal health worker or eligible aboriginal and torres strait islander health practitioner by a medical practitioner using a referral form that has been issued by the department or a referral form that substantially complies with the form issued by the department; and(c) the person is not an admitted patient of a hospital; and(d) the service is provided to the person individually and in person; and(e) the service is of at least 20 minutes duration; and(f) after the service, the eligible aboriginal health worker or eligible aboriginal and torres strait islander health practitioner gives a written report to the referring medical practitioner mentioned in paragraph (b):                  (i) if the service is the only service under the referral  in relation to that service; or                  (ii) if the service is the first or the last service under the referral  in relation to the service; or  (iii) if neither subparagraph (i) nor (ii) applies but the service involves matters that the referring medical practitioner would reasonably be expected to be informed of  in relation to those matters- to a maximum of  five services (including services to which items 81300 to 81360 inclusive apply) in a calendar year$$,'81300','M11');
