insert into billing.fee_schedule (descriptor, mbs_item, "group") values ($$Initial antenatal professional attendance by a participating midwife, lasting at least 40 minutes, including all of the following:(a) taking a detailed patient history;(b) performing a comprehensive examination;(c) performing a risk assessment;(d) based on the risk assessment - arranging referral or transfer of the patient’s care to an obstetrician;(e) requesting pathology and diagnostic imaging services, when necessary; (f) discussing with the patient the collaborative arrangements for her maternity care and recording the arrangements in the midwife’s written records in accordance with section 2e of the health insurance regulations 1975. payable once only for any pregnancy. $$,'82100','M13');
