insert into billing.fee_schedule (descriptor, mbs_item, "group") values ($$Professional attendance by a participating midwife, lasting at least 90 minutes, for assessment and preparation of a maternity care plan for a patient whose pregnancy has progressed beyond 20 weeks, if:(a) the patient is not an admitted patient of a hospital; and(b) the participating midwife undertakes a comprehensive assessment of the patient; and(c)  the participating midwife develops a written maternity care plan that contains:• outcomes of the assessment; and• details of agreed expectations for care during pregnancy, labour and   delivery; and• details of any health problems or care needs; and• details of collaborative arrangements that apply for the patient; and• details of any medication taken by the patient during the pregnancy, and any additional medication that may be required by the patient; and• details of any referrals or requests for pathology services or diagnostic imaging services for the patient during the pregnancy, and any additional referrals or requests that may be required for the patient; and(d) the maternity care plan is explained and agreed with the patient; and (e) the fee does not include any amount for the management of the labour and delivery. (includes any antenatal attendance provided on the same occasion).payable once only for any pregnancy. $$,'82115','M13');
